===High-risk worlds===
'''High Risk worlds''' (currently worlds 365, 474, 533 and PvP world {{#switch:{{#var:weekly}}|0=548|1=579}}) are worlds where players will lose '''all''' items on death due to having a special skull status over the head ([[File:Skull (High Risk PvP world) icon.png]]) at all times. Going into these worlds can be a [[risky]], but good way to [[Money making guide|make money]] if you have a high [[Combat level]] with good [[armour]] and [[weapons]] and are proficient in [[player-versus-player]] [[combat]]. '''It is strongly recommended that you only take items that you are willing to lose!''' Also, note that World 365, 474 and 533 are "safe" worlds unless you go into the [[Wilderness]] as they are not [[PvP]] worlds.

Upon killing any opponent, you will always get the items they were wearing and carrying, unless the item is (or was) [[untradeable]], in which case will usually turn into a stack of [[gold coins]] according to its value.

====Warning====
[[File:High Risk World warning (Login Screen).png|thumb|left|The warning received when selecting a High Risk world from the login screen.]]
[[File:High Risk World warning (World Switcher).png|thumb|Confirmation when selecting a High Risk world using the in-game World Switcher.]]
A warning is shown on attempting to login to a high-risk server from the login screen. If using the [[World Switcher]] instead, a confirmation will appear. Upon logging into a [[PvP world]], a chat message will appear saying {{RSFont|colour=red|This is a PvP World. Players may attack you once you leave this safe area.}}

